if mibBuilder.loadTexts: nms510DiagEndToEndSelftest.setDescription('To initiate an End to End Selftest(Error Rate Test) SET this object and specifiy a blocksize. Both the remote (nms510) amd master (sc5520) units will go into Selftest. The blocksize indicates the number of blocks the Selftest pattern generator will run. There are 1000 bits/block. Emuns 3 through 10 are write only. The only valid responses to a READ are selftestOn(2) or selftestOff(1). This test will terminate after the specified number of blocks have been run. Reading test results via the nms510DiagBitErrors or nms510DiagBlockErrors objects while the test is running will cause the test to terminate prematurely and render the results invalid. Test results should be read only after the test is completed and are available from both the remote (nms510) and master (sc5520) units. The current Test Status can be obtained by reading the sc5520DiagTestStatus object on the master unit, reading test status on the remote unit may interfere with the diagonostic test patternand cause errors. This test can also be terminated by seting the nms510DiagTestReset object. ')
