if mibBuilder.loadTexts: nms510DiagNetworkDelay.setStatus('mandatory')
if mibBuilder.loadTexts: nms510DiagNetworkDelay.setDescription('To initiate a Network Delay test SET this object and specifiy runDelayTest. Both the remote (nms510) and master (sc5520) units will go into a test to measure network delay. Emun 3 is write only. The only valid responses to a READ are delayTestOn(2) or delayTestOff(1). This test will terminate after 10 seconds. Test results should be read only after the test is completed and are available from the master (sc5520) unit. The current Test Status can be obtained by reading the sc5520DiagTestStatus object on the master unit, reading test status on the remote unit may interfere with the test and cause errors. This test can not be terminated early once it is started.')
nms510DiagTestStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 498, 8, 6, 7, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6))).clone(namedValues=NamedValues(("noTest", 1), ("internalLineloop", 2), ("externalDataloop", 3), ("internalDataloop", 4), ("serviceTestCenterLoop", 5), ("endToend", 6)))).setMaxAccess("readonly")
