if mibBuilder.loadTexts: nms510DiagTestStatus.setDescription('This object gives the current diagonostic test status. noTest indicates that no diagonostic test is currently active. Reading this object while in a diagonostic test involing two units may interfere with a selftest pattern and invalidate the test results. Reading the sc5520DiagTestStatus (master unit) object during dagonostic tests involing two unit will not disrupt the test results. ')
